import React from "react";
import "./Services.css";

export default function Services() {
  return (
    <div className="wrapper">
      <div className="services">
        <div className="s-1"></div>
        <div className="s-2"></div>
        <div className="s-3"></div>
      </div>
    </div>
  );
}
